var _hoisted_4 = /*#__PURE__*/(0,vue__WEBPACK_IMPORTED_MODULE_0__.createStaticVNode)("<div class=\"w-full sm:max-w-2xl mt-6 p-6 bg-white shadow-md overflow-hidden sm:rounded-lg prose\"><h2 class=\"term-title-page\">Políticas de Privacidade </h2><h3 class=\"term-subtitle-page\">IMAG DIAGNÓSTICO POR IMAGEM </h3><p style=\"text-align:left;\"><br><strong>Data da última atualização: 03/08/2021</strong></p><p style=\"text-align:left;\"><br><strong>O que você precisa saber antes de ler esta Política?</strong></p><p><br><strong>Dados Pessoais</strong> são todas as informações que permitem a sua identificação, a exemplo do seu nome, CPF, e-mail, telefone, entre outros.</p><p><br><strong>Dados Pessoais Sensíveis</strong> são dados pessoais relacionados à origem racial ou étnica, convicção religiosa, opinião política, filiação a sindicato ou a organização de caráter religioso, filosófico ou político, dado referente à saúde ou à vida sexual, dado genético ou biométrico, quando vinculados a você.</p><p><br><strong>Tratamento de Dados Pessoais</strong> significa qualquer operação realizada com dados pessoais, como coleta, produção, recepção, classificação, utilização, acesso, reprodução, transmissão, distribuição, processamento, arquivamento, armazenamento, eliminação, avaliação ou controle da informação, modificação, comunicação, transferência, difusão ou extração, realizada com dados pessoais.</p><p> </p><p><strong>1. O compromisso da IMAG com a proteção da sua privacidade</strong></p><p>Nesta página, descrevemos a forma como a IMAG realiza o tratamento dos seus dados pessoais, demonstrando o compromisso em tratar seus dados pessoais de forma responsável, transparente e com segurança, arantindo a sua privacidade e seus direitos. Nesse sentido, procuramos aqui esclarecer as regras sobre a coleta, o registro, o armazenamento, o uso, o compartilhamento e a eliminação dos dados pessoais coletados, dentro do escopo dos serviços oferecidos pela IMAG, de acordo com as leis em vigor, em especial a Lei nº 13.709/2018 (“Lei Geral de Proteção de Dados Pessoais”). Ao usar nossos serviços e nos fornecer seus dados pessoais, você aceita os termos e condições desta Política de Privacidade.</p><p> </p><p><strong>2. A quem está Política de Privacidade se aplica</strong></p><p style=\"text-align:justify;\">Esta Política de Privacidade se aplica a todo e qualquer visitante deste site, inclusive clientes e potenciais clientes da IMAG. Caso você seja um parceiro comercial da IMAG ou um interessado em trabalhar na empresa, outras<br>regras internas específicas com respeito à privacidade e proteção de dados pessoais são aplicáveis, na medida em que extrapolam o alcance das regras da presente Política de Privacidade, a qual serve aos objetivos e às finalidades da operação do site da IMAG.</p><p> </p><p><strong>3. Quais dados pessoais coletamos sobre o usuário e como fazemos a coleta</strong></p><p>Para oferecermos nossos serviços e melhorarmos continuamente a sua experiência e o uso do site da IMAG, coletamos os seguintes dados pessoais:</p><ul><li><strong>Informações de navegação:</strong> A IMAG coleta e armazena automaticamente informações em seus servidores sobre as atividades advindas do navegador, incluindo o endereço IP e a página acessada, através dos cookies. Os cookies permitem o reconhecimento dos computadores que acessam os sites e acompanham a navegação dentro das páginas do site, de maneira a personalizá-la de acordo com o perfil de cada visitante, usuário ou cliente. Para maiores informações sobre dados pessoais que são ou podem ser coletados durante a navegação dos usuários através de cookies, acesse nossa Política de Cookies. </li><li><strong>Informações de SAC:</strong> A IMAG coleta as mensagens enviadas por visitantes, usuários e clientes, a exemplo de dúvidas, críticas ou sugestões, sobre seu site e sobre os serviços nele comercializados. Essas informações poderão ser utilizadas posteriormente, para melhorar a comunicação, oferta de serviços, sem que a identidade individual e específica do autor seja revelada.</li><li>Dados de <strong>menores de idade:</strong> nossas plataformas e serviços são direcionados a um público adulto e não coletamos intencionalmente dados de crianças e adolescentes.</li><li><strong>Dados de circuito fechado de televisão:</strong> como decorrência do uso de câmeras de circuito fechado, a IMAG pode coletar imagens e gravações que contenham características físicas e comportamentais dos titulares que transitem em nossas dependências, com a finalidade de garantir a segurança interna e externa da IMAG, dos clientes, colaboradores e fornecedores da IMAG.</li></ul><p>Havendo necessidade, a IMAG pode receber seus dados pessoais ou dados de uso de terceiros, de forma adequada à legislação de proteção de dados. Por exemplo, se você estiver em outro site e optar por ser contatado pela IMAG, esse site transmitirá seu endereço de e-mail e outros dados pessoais para nós, para que possamos entrar em contato com você conforme solicitado.</p><p>Alguns sites, redes sociais ou aplicativos externos à IMAG podem fornecer links ou dar a possibilidade de conexão com outros canais da IMAG, serviços, redes sociais ou aplicativos. Clicar nesses links ou permitir a conexão possibilitará a coleta e o compartilhamento de suas informações por terceiros. Consulte sempre as políticas de privacidade e os termos de uso de sites ou serviços que não estão sob a responsabilidade da IMAG, antes de fornecer a eles seus dados pessoais.</p><p> </p><p><strong>4. Para quais finalidades usamos os dados pessoais</strong></p><p>A IMAG é controladora de dados pessoais e, nessa qualidade, promove o tratamento de dados pessoais coletados por meio de seu site, por e-mail e/ou outros meios de comunicação, ou, ainda, presencialmente, para atendimento das finalidades informadas nesta Política de Privacidade, na Política de Cookies e nos respectivos termos de uso do site, considerando o princípio da minimização dos dados, incluindo, mas a tanto não se limitando, as seguintes finalidades:</p><p><strong>a. Cumprimento de obrigações legais e regulatória.</strong> Existem várias leis federais, estaduais e municipais e normas regulatórias que são específicas da atividade desempenhada pela IMAG, que é obrigada a cumpri-las. Desse modo, alguns dados pessoais serão coletados para cumprir essas exigências legais e regulatórias.</p><p><strong>b. Exercício regular de direitos em processo judicial, administrativo ou arbitral. </strong>Precisaremos permanecer com seus dados para, caso seja necessário, atender ao Judiciário, Ministério Público, Procon, dentre outros.</p><p><strong>c. Tutela da Saúde.</strong> Podemos tratar dados pessoais obtidos em atendimentos ambulatoriais e/ou médicos realizados na IMAG, a fim de preservar e proteger a saúde e bem estar dos titulares.</p><p><strong>d. Execução de contrato.</strong> Podemos tratar dados pessoais para cumprir nossas obrigações contratuais ou celebrar contratos.</p><p><strong>e. Interesses legítimos.</strong> Podemos tratar os dados pessoais baseado em interesse legítimo, desde que o tratamento seja realizado de forma justa, razoável e equilibrada, tais como:</p><ol><li>Para viabilizar a prestação de nossos serviços aos titulares;</li><li>Para prospectar clientes e parceiros de negócios;</li><li>Para fornecer conteúdos personalizados de interesse do titular, através de marketing direto;</li><li>Para informar os titulares sobre eventos, campanhas, dentre outras atividades de interesse do titular e que o possam beneficiar de alguma forma.</li><li>Para apurar denúncias e fazer auditorias;</li></ol><p><br><strong>f. Atividades que exigem seu consentimento.</strong> Podemos utilizar os dados pessoais que você nos autorizar de forma voluntária e por meio do seu consentimento livre, informado e inequívoco para o armazenamento de cookies em seu terminal final, inclusive cookies para podermos analisar e medir o tráfego e as estatísticas dos usuários em nosso site. Para mais informações sobre como a coleta e armazenamento automático de  informações de navegação são realizadas, leia nossa Política de Cookies. Também solicitaremos seu consentimento para envio de publicidade e avisos, de nossos informativos e de outras comunicações de marketing, inclusive de terceiros, por e-mail, chat e outros meios de comunicação. Você poderá, a qualquer momento, mediante manifestação gratuita e facilitada, enviar e-mail para <span style=\"text-decoration:underline;\">adm@imagdiagnostico.com.br</span> com o objetivo de revogar seu consentimento quanto ao uso de seus dados pessoais pela IMAG para certas finalidades.</p><p>Destacamos que toda <strong>comunicação com você, seja por telefone, por e-mail ou qualquer outro </strong><strong>canal, inclusive redes sociais, será gravada e guardada.</strong></p><p> </p><p><strong>5. Com quem compartilhamos os dados pessoais?</strong></p><p>A IMAG compartilha os dados pessoais com parceiros e fornecedores autorizados para atendimento das finalidades informadas nesta política, tendo ainda que compartilhar com terceiros dentro das hipóteses de cumprimento de obrigação legal ou regulatória, cumprimento do contrato, proteção de crédito ou segurança do usuário. Nesses casos, a IMAG irá compartilhar o mínimo de informações necessárias para atingir sua finalidade, garantindo sempre que possível, a anonimização dos dados pessoais.</p><p><strong>Subcontratados:</strong> Além de realizar o tratamento de dados pessoais por contra própria, a IMAG pode subcontratar serviços de terceiros (p. ex.: para realização de campanhas e eventos, para realizar certos tratamentos de dados pessoais em seu favor. Suas informações só serão compartilhadas com terceiros se eles tiverem um relacionamento comercial e contrato firmado com a IMAG.<br>A IMAG subcontratará serviços de processamento e armazenamento de dados somente de empresas com a respectiva especialidade, garantindo todos os direitos do titular dos dados e impondo regras e responsabilidade ao operador subcontratado.</p><p><strong>Autoridades públicas e/ou Órgãos oficiais:</strong> As informações pessoais poderão ser compartilhadas quando houver requerimento de autoridades judiciais ou governamentais competentes, mesmo que não exista uma ordem judicial, por exemplo, quando tratar-se de investigação de caráter penal ou a violação de direitos do autor, ressalvadas as hipóteses de sigilo de informações determinadas pela legislação vigente, ou, ainda, comunicação de informações quando haja motivos suficientes para considerar que a atividade de um usuário seja suspeita de incidir em um delito ou, ainda, de prejudicar outras pessoas.</p><p> </p><p><strong>6. Sites de terceiros</strong></p><p>O site da IMAG pode conter links para outros sites operados por terceiros. A IMAG não se responsabiliza pelas práticas de privacidade de sites operados por terceiros ligados por link, ou pelas práticas de privacidade de terceiros anunciantes da Internet. A inclusão desses links não implica endosso desses sites, sendo recomendável que você leia as respectivas políticas de privacidade e de cookies para saber como esses terceiros realizam o tratamento de seus dados pessoais.</p><p> </p><p><strong>7. Segurança dos dados</strong></p><p>A IMAG envidará seus melhores esforços para proteção da informação, principalmente dados pessoais, aplicando as medidas de segurança, técnicas e administrativas necessárias e disponíveis à época, para a proteção dos dados pessoais contra acessos não autorizados e a ocorrência de situações acidentais ou ilícitas de destruição, perda, alteração, comunicação ou qualquer forma de tratamento inadequado ou ilícito, exigindo de seus fornecedores o mesmo nível aceitável de Segurança da Informação, com base em melhores práticas de mercado, a partir de cláusulas contratuais.</p><p> </p><p><strong>8. Transferência internacional de dados pessoais</strong></p><p>Os dados coletados serão armazenados em servidores próprios localizados no Brasil, bem como em ambiente de uso de recursos ou servidores na nuvem, o que enseja, neste último caso, transferência ou processamento dos dados fora do Brasil, hipótese na qual serão observadas as disposições sobre transferência internacional de dados, conforme artigo 33 da Lei Geral de Proteção de Dados e normas regulamentadoras aplicáveis.</p><p><br>Sempre que houver transferência internacional de dados pessoais, conforme mencionado acima, tomaremos as medidas razoavelmente necessárias para garantir que são implementadas as medidas de segurança adequadas para proteger as suas informações pessoais.</p><p> </p><p><strong>9. Veracidade dos Dados</strong></p><p>A IMAG não é responsável pela precisão, veracidade ou falta dela nas informações prestadas por você, titular dos dados pessoais, ou pela sua desatualização, sendo você o responsável por prestálas com exatidão e/ou atualizá-las.</p><p><br>A IMAG não se obriga a processar ou tratar quaisquer de seus dados se houver razões para crer que tal tratamento possa imputar à IMAG infrações de qualquer lei aplicável, bem como para fins ilegais, ilícitos ou contrários à moralidade.</p><p> </p><p><strong>10. Por quanto tempo conservamos os dados pessoais</strong></p><p>Iremos conservar as suas informações pessoais pelo período necessário para o cumprimento das finalidades descritas nesta Política de Privacidade, a não ser que um prazo de conservação superior seja exigido ou permitido por lei, a exemplo de prazo para cumprimento de obrigações tributárias e de garantia.</p><p>Assim sendo, poderemos manter um registro das trocas de e-mail ou correspondências trocadas com você pelo tempo que for apropriado para o exercício regular de direitos em processo judicial. Nesse caso, por exemplo, a IMAG poderá conservar dados pessoais por prazo mínimo de 5 (cinco) anos, tendo como fundamento legal o art. 27 do Código de Defesa do Consumidor, que estabelece esse prazo para o usuário consumidor pleitear judicialmente a reparação por danos que lhe foram causados por serviço que adquiriu.</p><p>Nos casos de dados pessoais coletados com base no consentimento, enquanto durar a relação e não houver pedido de apagamento ou revogação de consentimento por você, com base no art. 9ª da Lei Geral de Proteção de Dados, também manteremos armazenados os seus dados pessoais.</p><p> </p><p><strong>11. Quando ocorre o término do tratamento de dados pessoais</strong></p><p>Os dados pessoais serão eliminados após o término de seu tratamento, inclusive em decorrência de solicitação do usuário para eliminação de seus dados ou revogação de seu consentimento. No entanto, pode a IMAG precisar manter os dados pessoais por período superior, nos termos do art. 16 da Lei Geral de Proteção de Dados, para cumprimento de obrigação legal ou regulatória; transferência a terceiro, respeitados os requisitos de tratamento de dados dispostos na mesma lei; ou para seu uso exclusivo, vedado seu acesso por terceiro, e desde que anonimizados os dados.</p><p><br>Findo o prazo e a necessidade legal, os dados serão excluídos com uso de métodos de descarte seguro ou utilizados de forma anonimizada para fins estatísticos.</p><p> </p><p><strong>12. Quais os direitos do titular dos dados pessoais</strong></p><p>Os usuários possuem direitos no que se refere aos dados pessoais, dentre eles:</p><ul><li><strong>Confirmação da existência de tratamento de dados pessoais:</strong> Mediante sua solicitação, através do e-mail adm@imagdiagnostico.com.br, a IMAG concederá a confirmação ou não da existência de tratamento de dados pessoais, nos termos da legislação aplicável.</li><li><strong>Acesso aos dados pessoais:</strong> Você poderá requisitar acesso aos seus dados pessoais coletados e que estejam armazenados pela IMAG, através do e-mail <span style=\"text-decoration:underline;\"><a href=\"mailto:adm@imagdiagnostico.com.br\">adm@imagdiagnostico.com.br</a></span></li><li><strong>Correção de dados incompletos, inexatos ou desatualizados:</strong> Você poderá, a qualquer momento, pedir alterar ou atualizar os seus dados pessoais, enviando e-mail para <span style=\"text-decoration:underline;\"><a href=\"mailto:adm@imagdiagnostico.com.br\">adm@imagdiagnostico.com.br</a></span></li><li><strong>Informações sobre uso compartilhado de dados:</strong> As informações sobre o compartilhamento de dados pessoais encontram-se nesta Política de Privacidade. Mesmo assim, a IMAG coloca-se à disposição para a hipótese de esclarecimentos complementares através do email <span style=\"text-decoration:underline;\"><a href=\"mailto:adm@imagdiagnostico.com.br\">adm@imagdiagnostico.com.br</a></span></li><li><strong>Eliminação dos dados pessoais: </strong>Você poderá solicitar, através do e-mail <span style=\"text-decoration:underline;\"><a href=\"mailto:adm@imagdiagnostico.com.br\">adm@imagdiagnostico.com.br</a></span>, a eliminação de dados pessoais que tenham sido coletadas pela IMAG a partir do seu consentimento, a qualquer momento, mediante manifestação gratuita e facilitada. A eliminação dos dados pessoais somente poderá ser completa para dados pessoais que não sejam necessários para a empresa cumprir com obrigações legais e regulatórias, contratuais, e nas demais hipóteses admitidas legalmente. Assim, por exemplo, no caso de cancelamento da subscrição das nossas comunicações de marketing, a IMAG irá manter um registro dos dados de contato do usuário para garantir que não lhe serão enviadas comunicações de marketing adicionais no futuro.</li><li><strong>Manifestação de oposição e/ou revogação do consentimento:</strong> Você poderá, a qualquer momento, mediante requisição gratuita e facilitada, enviar e-mail para <span style=\"text-decoration:underline;\">adm@imagdiagnostico.com.br </span>manifestando sua oposição ou revogando o consentimento quanto ao uso de seus dados pessoais pela IMAG para certas finalidades. Você deve estar ciente de que os tratamentos realizados anteriormente à revogação do consentimento são ratificados e que o pedido de revogação não implicará na eliminação dos dados pessoais anteriormente tratados e que sejam mantidos pela IMAG com base em outros fundamentos legais.</li></ul><p>Se você desejar exercer qualquer um desses direitos, poderá entrar em contato com o Encarregado de proteção de dados pessoais (DPO - Data Protection Officer) da IMAG, através do e-mail <span style=\"text-decoration:underline;\">adm@imagdiagnostico.com.br.</span> No caso de alguma solicitação sobre seus direitos, podemos solicitar comprovação da sua identidade, como medida de segurança e prevenção à fraude.</p><p> </p><p><strong>13 - Encarregado de Dados</strong></p><p>Para todos os efeitos de tratamento de dados, a IMAG conta com a figura do Encarregado de proteção de dados pessoais abaixo denominado para atuar como canal de comunicação entre a empresa, os titulares dos dados e a Autoridade Nacional de Proteção de Dados (ANPD).</p><p><span style=\"text-decoration:underline;\"><em>Encarregado de Proteção de Dados (DPO - Data Protection Officer):</em></span><br><em>Nome: Wai Kene Chan</em><br><em>Email: <span style=\"text-decoration:underline;\"><a href=\"mailto:adm@imagdiagnostico.com.br\">adm@imagdiagnostico.com.br</a></span></em></p><p> </p><p><strong>14. Canais de Atendimento de Privacidade</strong></p><p>Em caso de sugestões, dúvidas, reclamações ou solicitações relacionadas a esta Política de Privacidade ou caso queira exercer os direitos relacionados aos seus dados pessoais, entre em contato com o Encarregado da IMAG por meio do e-mail <a href=\"mailto:adm@imagdiagnostico.com.br\">adm@imagdiagnostico.com.br</a></p><p> </p><p><strong>15. Atualização da Política de Privacidade</strong></p><p>A IMAG se reserva o direito de alterar esta Política de Privacidade a qualquer momento, sobretudo visando à manutenção da conformidade de seu teor com disposição de lei ou de regulamento, cabendo ao usuário verificá-la previamente a cada vez que visitar nosso site, bem como acessar ou adquirir serviços neles ofertados. Para facilitar, indicamos neste documento a data de sua última atualização.</p><p> </p><p><strong>16. Comunicação</strong></p><p>Você reconhece que toda comunicação realizada por e-mail aos endereços informados no seu cadastro é válida como prova documental, sendo eficaz e suficiente para divulgação de qualquer assunto referente aos serviços oferecidos pela IMAG, ressalvadas as disposições expressamente previstas nesta Política de Privacidade.</p><p>Por fim, reforçamos que o titular de dados é responsável pelo sigilo de suas informações pessoais, sendo vedado o compartilhamento de seu login, senhas ou qualquer tipo de credencial de acesso ou autenticação junto à IMAG.</p><p> </p><p><strong>17. Lei Aplicável e Foro</strong></p><p>Este documento é regido e deve ser interpretado de acordo com as leis brasileiras. Fica eleito o Foro da Comarca de Recife, estado de Pernambuco, como o competente para dirimir quaisquer questões porventura oriundas do presente documento, com expressa renúncia a qualquer outro, por mais privilegiado que seja.</p><div class=\"term-content\"><h2 class=\"term-title-page\">Políticas de Cookies </h2><h3 class=\"term-subtitle-page\">IMAG DIAGNÓSTICO POR IMAGEM </h3><p> </p><p>A presente Política de Cookies é um documento complementar à Política de Privacidade da <strong>IMAG DIAGNÓSTICO POR IMAGEM,</strong> que também está disponível no site<em>.</em></p><p>Os cookies usados no site da <strong>IMAG DIAGNÓSTICO POR IMAGEM</strong> são categorizados e você pode ler sobre cada categoria e permitir ou negá-los.</p><p>Aqui, você encontrará informações objetivas e claras sobre o que são Cookies, quais Cookies utilizamos em nossas aplicações, qual papel desempenham e como configurá-los.</p><br><br><h4><strong> O que são cookies?</strong></h4><p>Cookies são pequenos arquivos de texto ou fragmentos de informação que são baixados em seu computador, smartphone ou qualquer outro dispositivo com acesso à internet quando você visita nosso site.</p><p>Eles contêm informações sobre a sua navegação em nossas páginas e retêm apenas aquelas que forem relacionadas as suas preferências.</p><p>Assim, o nosso site consegue armazenar e recuperar os dados sobre os seus hábitos de navegação, de forma a melhorar a experiência de uso, por exemplo. É importante destacar que eles não contêm informações pessoais específicas, como dados sensíveis ou bancários.</p><br><br><h4><strong> Para que servem os cookies?</strong></h4><p>A <strong>IMAG DIAGNÓSTICO POR IMAGEM</strong> utiliza Cookies para fornecer uma melhor experiência de uso para você, tornando as aplicações mais fáceis e personalizadas, tendo por base suas escolhas e comportamento de navegação.</p><p>Desta forma, buscamos entender como você utiliza nosso site para ajustarmos o conteúdo para torná-lo mais relevante para você, além de lembrar de suas preferências.</p><br><br><h4><strong> Posso escolher os cookies de minha preferência?</strong></h4><ul><li>importante você saber que os cookies que não são estritamente necessários para navegar em nosso site, apenas serão usados após o seu consentimento.</li></ul><p>Você poderá configurar e gerenciar a permissão concedida para cada tipo de cookies individualmente, podendo desativá-los ou ativá-los a qualquer momento.</p><ul><li>possível desabilitar, por meio das configurações de seu navegador de internet, a coleta automática de informações por meio de algumas tecnologias, como cookies e caches, bem como em nosso próprio website, especificamente quanto aos cookies.</li></ul><br><br><h4><strong> Quais tipo de Cookies utilizamos?</strong></h4><p>Listamos abaixo todos os Cookies que podem ser utilizados pela <strong>IMAG DIAGNÓSTICO POR IMAGEM</strong> <em>.</em></p><p><strong>| Cookies de desempenho</strong></p><p>Os cookies de desempenho coletam informações sobre como suas páginas são utilizadas, para que possam ser melhoradas. Estes cookies, como o Google Analytics, facilitam, por exemplo, identificar se são visitadas algumas subpáginas de nosso site, e quais. Além disso, qual o tipo de conteúdo que suscita maior interesse a você. Registramos, especialmente, o número de vezes que uma página é acessada, o país, a região e, se aplicável, a cidade a partir da qual as páginas são acessadas. O endereço IP de seu computador, transmitido por motivos técnicos, é automaticamente anonimizado e não nos permite tirar qualquer conclusão sobre você.</p><p>Poderemos usar as informações que obtivermos dos cookies e uma análise anônima de seu padrão de utilização de nossas páginas, a fim de exibir publicidade específica para alguns de nossos produtos em nosso site. Acreditamos que esta ação beneficia você como usuário, pois divulgamos publicidade ou conteúdos que acreditamos corresponderem a seus interesses com base em seu comportamento de navegação. Portanto, você verá menos publicidade exibida aleatoriamente e menos conteúdos que não são de seu interesse.</p><p><strong>| Cookies de Marketing e redes sociais – OPT IN – OPT OUT</strong></p><p>Estes cookies permitem que você compartilhe nosso conteúdo nas suas redes sociais. Também podem ser usados para rastrear visitantes em sites para permitir que os editores exibam anúncios com base em seu perfil de usuário e preferências. Além disso, também guardam dados sobre quantos visitantes viram ou clicaram nos nossos anúncios, a fim de otimizar as campanhas publicitárias.</p><p>As informações poderão ser compartilhadas com alguns de nossos parceiros de serviço, tais como:</p><p>Youtube, Google, FaceBook, LinkedIn e Instagram.</p><p>A qualquer momento você poderá revogar seu consentimento quanto aos cookies, devendo apagá-los das páginas da <strong>IMAG DIAGNÓSTICO POR IMAGEM</strong>, utilizando as configurações de seu navegador de preferência. Para mais informações sobre como proceder em relação à gestão dos cookies nos navegadores:</p><p><strong>Google Chrome</strong></p><p><a href=\"https://support.google.com/accounts/answer/61416?co=GENIE.Platform%3DDesktop&amp;hl=pt-BR\">https://support.google.com/accounts/answer/61416?co=GENIE.Platform%3DDesktop&amp;hl=pt-</a><a href=\"https://support.google.com/accounts/answer/61416?co=GENIE.Platform%3DDesktop&amp;hl=pt-BR\">BR</a></p><p> </p><p><strong>Mozilla Firefox:</strong></p><p><a href=\"https://support.mozilla.org/pt-BR/kb/ative-e-desative-os-cookies-que-os-sites-usam\">https://support.mozilla.org/pt-BR/kb/ative-e-desative-os-cookies-que-os-sites-usam</a></p><p> </p><p>Lembre-se que, caso você não aceite alguns cookies das páginas da <strong>IMAG DIAGNÓSTICO POR IMAGEM</strong>, alguns serviços poderão não funcionar de maneira ideal e você não terá acesso<strong></strong>a determinados benefícios. </p><p>Se você <strong>tiver alguma dúvida</strong> sobre nossas políticas entre em contato com o nosso encarregado, no endereço abaixo:</p><p><strong><u>Encarregado de Proteção de Dados (DPO - Data Protection Office)</u></strong></p><p><strong>Nome</strong>: Wai Kene Chan</p><p><strong>Email: </strong><span style=\"text-decoration:underline;\"><a href=\"mailto:adm@imagdiagnostico.com.br\">adm@imagdiagnostico.com.br</a></span></p></div></div>", 1);

